"261102":{"id":"261102","name":"A Vida Secreta das Esposas Mórmons","slug":"a-vida-secreta-das-esposas-mormons","original_title":"The Secret Lives of Mormon Wives","overview":"O mundo escandaloso de um grupo de mães mórmons influenciadoras implode quando elas são pegas no meio de um escândalo sexual que vira manchete internacional. Agora, sua irmandade é abalada até o âmago. Fé, amizade e reputação estão em jogo.","first_air_date":"2024-09-06","episode_run_time":0,"vote_average":6.3,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Jeff Jenkins Productions","3 Ball Productions","Walt Disney Television Alternative"],"genres":["Reality"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/aMyzESNgwhSUXovhEEHQmXcHGOS.jpg","poster_path":"https://image.tmdb.org/t/p/original/2AczClE0HMjsIk1VcJcGUebwODA.jpg","cast":["Whitney Leavitt","Mikayla Matthews","Jen Affleck","Jessi Ngatikaura","Layla Taylor"],"trailer":"Qu5xV6XvCCM","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4ivEHGvh39VTEJvx3pD32BbcYPB.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4ivEHGvh39VTEJvx3pD32BbcYPB.jpg","air_date":"2024-09-06","episode_count":8,"overview":"O mundo escandaloso de um grupo de mães mórmons influenciadoras implode quando elas são pegas no meio de um escândalo sexual que vira manchete internacional. Agora, sua irmandade é abalada até o âmago. Fé, amizade e reputação estão em jogo. Será que o #MomTok sobreviverá e continuará a dar trabalho ao livro de regras, ou será que o grupo cairá em desgraça?","vote_average":7.9,"episodes":{"1":{"name":"O Primeiro Livro de Taylor","overview":"Depois que o escândalo de swing do grupo #MomTok se torna viral no mundo todo, uma reviravolta chocante muda a vida de Taylor Frankie Paul para sempre. Whitney retorna do exílio e mais segredos são revelados, abalando o #MomTok até o âmago.","air_date":"2024-09-06","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/xQOed88zn7mCsAlGr0TeP4J0r2c.jpg","vote_average":7.5},"2":{"name":"O Livro do Pertencimento","overview":"Alianças são testadas quando uma nova Abelha Rainha do #MomTok se declara. Whitney recebe uma proposta para fazer uma publicidade provocativa para uma marca, colocando o tema \"religião versus sexualidade\" em primeiro plano.","air_date":"2024-09-06","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/4pqioa4maQlM7z7J5oilTvR7A0S.jpg","vote_average":6.2},"3":{"name":"O Livro dos Santos e Pecadores","overview":"Quando uma das influenciadoras comete um \"pecado\" em uma festa conservadora, o grupo se divide em relação a qual rota tomar para restabelecer a imagem do #MomTok.","air_date":"2024-09-06","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/59w9xiXWnspxdgoGmP5neAhiiUl.jpg","vote_average":0},"4":{"name":"O Livro da Verdade","overview":"Uma viagem de aniversário vira uma loucura depois que um jogo escandaloso força a verdade a ser revelada. Taylor finalmente confronta Whitney, levando uma delas a questionar se quer continuar no #MomTok.","air_date":"2024-09-06","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/5pyOl8rZaehs3lauA4jVBX8OMnr.jpg","vote_average":10},"5":{"name":"O Livro dos Votos Quebrados","overview":"Taylor revela seus verdadeiros sentimentos sobre um futuro com Dakota, Layla comemora seu divórcio e uma nova líder é nomeada na ausência de Whitney.","air_date":"2024-09-06","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/71Qn8msGHclb2UMfTXhAFIAxyfQ.jpg","vote_average":0},"6":{"name":"O Primeiro Livro do Pecado","overview":"Uma viagem para Las Vegas testa fé, amizade e coloca casamentos em risco.","air_date":"2024-09-06","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/bhGLtbSzgLwhCYfAoCyVnQMp0IE.jpg","vote_average":0},"7":{"name":"O Livro da Confiança","overview":"Após uma viagem explosiva para Las Vegas, Mayci revela um segredo chocante para Taylor, Jen tenta salvar seu casamento e o #MomTok tenta salvar Jen.","air_date":"2024-09-06","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/5bKPL3ueHfbLfb5V0cMXUUULJjc.jpg","vote_average":0},"8":{"name":"O Livro dos Rumores","overview":"Dakota confronta Mayci, um convidado inesperado causa uma comoção e o futuro das garotas com o #MomTok está em jogo neste final de temporada explosivo.","air_date":"2024-09-06","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/wBAk7PxqtjMqThIEGKFwNM7PjW0.jpg","vote_average":0}}}}},
