"258035":{"id":"258035","name":"Um Contador no Mundo do Crime","slug":"um-contador-no-mundo-do-crime","original_title":"त्रिभुवन मिश्रा - सीए टॉपर","overview":"Após uma crise bancária, o contador Tribhuvan Mishra começa a fazer bico como profissional do sexo. Mas será que essa vida dupla vai causar ainda mais problemas?","first_air_date":"2024-07-18","episode_run_time":0,"vote_average":6.6,"number_of_seasons":1,"number_of_episodes":9,"created_by":["Puneet Krishna"],"production_companies":["Rangeela Pictures"],"genres":["Drama","Comédia","Crime"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/gtgE02vlDumpMBjJRlZlvf2spfY.jpg","poster_path":"https://image.tmdb.org/t/p/original/jkWMRTlTDkRPRkr89b2uasG4qTU.jpg","cast":["Manav Kaul","Tillotama Shome","Subhrajyoti Barat","Shweta Basu Prasad","Naina Sareen"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/ukWcooXxcL1UZ2aXqZQ0VqJcE5m.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/ukWcooXxcL1UZ2aXqZQ0VqJcE5m.jpg","air_date":"2024-07-18","episode_count":9,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"Romance, ação e drama","overview":"Tribhuvan Mishra leva uma vida feliz, só que péssimas notícias chegam para abalar a situação. O confeiteiro Teeka Ram Jain faz hora extra como Raja Bhai.","air_date":"2024-07-18","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/kW1sYnMo7aEHmrGtznbl3l3CA9N.jpg","vote_average":7},"2":{"name":"Idiota","overview":"Aparece um adversário para Raja Bhai. Estressado e desesperado para conseguir dinheiro, Tribhuvan descobre um talento que pode dar uma mãozinha.","air_date":"2024-07-18","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/v1MGy4EMeuPMCYj9VMrVovUTxcp.jpg","vote_average":0},"3":{"name":"DilDesire.com","overview":"Tribhuvan se torna um homem que sabe exatamente o que as mulheres querem. Ele sugere uma receita de bolo para Ashoklata, mas ela não sabe de onde veio.","air_date":"2024-07-18","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/t9eAugqppupQ9rY96eIWliEvnXy.jpg","vote_average":0},"4":{"name":"Bunty e Babli","overview":"Ashoklata e Tribhuvan abrem uma confeitaria. Bindi está sendo observada e Haider Ali investiga Raja Bhai. A popularidade do contador cresce cada vez mais.","air_date":"2024-07-18","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/lIFf5uq26nkI8esIfSCkTGFc10N.jpg","vote_average":0},"5":{"name":"Madhur Milaap","overview":"Pressionada pela mãe, Ashoklata suspeita do marido. Em um encontro com Bindi, tudo dá muito errado para Tribhuvan.","air_date":"2024-07-18","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/jjAUDTosBcGz2eN3jYkEAKv4Jmv.jpg","vote_average":0},"6":{"name":"Gigolô","overview":"O inspetor Haider Ali faz uma descoberta importante. Shambhu recebe uma ameaça, mas Shobha o salva. Raja Bhai e Dhaincha prometem achar o culpado.","air_date":"2024-07-18","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/cLCSyME1SNEi7DPWXehduQzR4sL.jpg","vote_average":0},"7":{"name":"Bolas de aço","overview":"Dhaincha revela informações importantes. Tribhuvan planeja tudo para proteger a família, mas o caos toma conta quando Shobha e Shambhu se envolvem.","air_date":"2024-07-18","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/rPWgji1nN1G6UvXX0BAqN9EyHDb.jpg","vote_average":0},"8":{"name":"Guns N Roses","overview":"Raja Bhai tenta impressionar Bindi, mas ela tem uma surpresa para ele. Tribhuvan decide fazer mudanças. A polícia reúne mais evidências comprometedoras.","air_date":"2024-07-18","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/npAKjJistWL5jRmlR0BYU2sqmdZ.jpg","vote_average":0},"9":{"name":"Encontro em família","overview":"Dhaincha se abre sobre o passado com Bindi. Agora que o caos tomou conta, será que os segredos de Tribhuvan serão revelados?","air_date":"2024-07-18","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/iIuDNmI09F2MO6jP6kXvhW5Afgu.jpg","vote_average":0}}}}},
