"135529":{"id":"135529","name":"Sociedade do Cansaço","slug":"sociedade-do-cansaco","original_title":"Sociedade do Cansaço","overview":"\"Sociedade do Cansaço” é uma série documental que investiga como nossa sociedade atual, movida pelo desempenho e produtividade constantes, vem a engatilhar desamparos mentais e físicos na população.","first_air_date":"2021-09-22","episode_run_time":27,"vote_average":0,"number_of_seasons":1,"number_of_episodes":10,"created_by":[],"production_companies":["Spray Filmes","GNT"],"genres":["Documentário"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/wfvBr0ivYrPInwpkQ989C2YAfoc.jpg","poster_path":"https://image.tmdb.org/t/p/original/nOa8wQaHTkOigbJuU3j844uwahC.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2021-09-22","episode_count":10,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Trabalho Me Cansa","overview":"A informalidade e jornada de trabalho sobem, enquanto salários e direitos trabalhistas diminuem. Somos explorados e exploradores. Viramos seres unicamente voltados ao trabalho?","air_date":"2021-09-22","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"Perfeição Me Cansa","overview":"Somos bombardeados por imagens idealizadas nas mídias sociais, constantemente nos lembrando quão imperfeitos somos. Quais os efeitos dessas imagens na saúde mental das pessoas?","air_date":"2021-09-29","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"Remédio Me Cansa","overview":"Tomamos remédios, polivitamínicos e até drogas psicodélicas para melhorar nosso desempenho. Mas ao tratarmos nosso cérebro como uma máquina, perdemos a essência de quem somos?","air_date":"2021-10-06","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Lazer Me Cansa","overview":"Na “Sociedade do Cansaço”, com o tempo escasso, o que era para ser tempo livre agora se torna obrigação e exigência. Será que vivemos numa tirania do lazer produtivo?","air_date":"2021-10-13","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"Sono Me Cansa","overview":"O sono só recarrega, não permite sonhar. Quais os efeitos da falta de sono devido ao excesso de trabalho e estímulos gerados pela sociedade do desempenho?","air_date":"2021-10-20","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"6":{"name":"Internet Me Cansa","overview":"Nossas vidas são pautadas pela lógica do virtual. Se estamos tão conectados, por que estamos nos sentindo tão sozinhos, desamparados e ansiosos?","air_date":"2021-10-27","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"7":{"name":"Relacionamentos me Cansam","overview":"Veja que não há motivo para a busca por um parceiro amoroso ser diferente do restante da vida.","air_date":"2021-11-03","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"8":{"name":"Consumo me Cansa","overview":"Veja até que ponto deixamos de consumir roupas, objetos, experiências e elas passam a nos consumir.","air_date":"2021-11-10","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"9":{"name":"Positividade me Cansa","overview":"A positividade é a nova religião da sociedade do desempenho. Veja os efeitos de seu excesso.","air_date":"2021-11-17","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"10":{"name":"Segurança me Cansa","overview":"O medo e a violência aumentam a cada dia e atingem sobretudo aos mais vulneráveis.","air_date":"2021-11-24","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
