"97363":{"id":"97363","name":"Visible: Out on Television","slug":"visible-out-on-television","original_title":"Visible: Out on Television","overview":"Explore a história do movimento LGBTI através das lentes da TV nesta série documental em cinco partes. Com imagens de arquivo e novas entrevistas, a série aborda a homofobia, a evolução de personagens LGBTI e como é se assumir na indústria televisiva.","first_air_date":"2020-02-14","episode_run_time":0,"vote_average":7.1,"number_of_seasons":1,"number_of_episodes":5,"created_by":["David Bender"],"production_companies":["Permut Presentations","Push It Productions","Tripod Media"],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/f2PXqEhq3WnDYdHuTL8vJblo9Jl.jpg","poster_path":"https://image.tmdb.org/t/p/original/xJocd94qiar0XGWUZdV6ncsoOOF.jpg","cast":["Janet Mock","Margaret Cho","Asia Kate Dillon","Neil Patrick Harris","Lena Waithe"],"trailer":"m1D9O35aVFY","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/oJwsRdgriPhF9FcCcGHXndnFr01.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/oJwsRdgriPhF9FcCcGHXndnFr01.jpg","air_date":"2020-02-14","episode_count":5,"overview":"N/A","vote_average":8.4,"episodes":{"1":{"name":"A idade das trevas","overview":"Os primórdios da TV retratavam os LGBTI como maníacos homicidas e pervertidos sexuais. A representação positiva surgiu só nos anos 70.","air_date":"2020-02-14","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/aABCfTJ82j8cWJH8ZVhftrYzdc1.jpg","vote_average":8},"2":{"name":"A televisão como ferramenta","overview":"Após a Rebelião de Stonewall, ativistas LGBTI começaram a usar a TV como uma ferramenta de mudança.","air_date":"2020-02-14","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/9tcvctNTlrfW5nZtqnO3yv0bMUY.jpg","vote_average":8},"3":{"name":"A epidemia","overview":"No início, a TV ignorou o vírus HIV e a AIDS, e o medo da doença enfraqueceu a representação LGBTI. Depois, a TV ajudou na conscientização.","air_date":"2020-02-14","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/njEaAY69gam0Z25UndWx8Dm75ph.jpg","vote_average":8},"4":{"name":"Avanços","overview":"Em 1997, Ellen DeGeneres fez história ao se assumir em seu programa de TV e na vida pessoal. Mas a comemoração duraria pouco.","air_date":"2020-02-14","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/hcXX1kbEQcSHesoEpDJHLQFTSRR.jpg","vote_average":9},"5":{"name":"A nova era","overview":"O panorama da TV atual abriu as portas para uma nova geração de criadores LGBTI, que buscam mais representação e inclusão.","air_date":"2020-02-14","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/sBPPSaROWqrYEBlGX5yjwFAiloh.jpg","vote_average":9}}}}},
