"215232":{"id":"215232","name":"Na Luta","slug":"na-luta","original_title":"Contra las cuerdas","overview":"Ángela saiu da prisão e quer reconquistar o respeito da filha, que é fã de luta livre. Não há motivo melhor para subir no ringue, certo?","first_air_date":"2023-01-25","episode_run_time":0,"vote_average":8.9,"number_of_seasons":1,"number_of_episodes":10,"created_by":["Carolina Rivera"],"production_companies":[],"genres":["Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/bqpd4SQ2i7MnHTHlkRgqj2CuQP5.jpg","poster_path":"https://image.tmdb.org/t/p/original/4TmFxjmCdnOAuRcyaqzHo7sJkG8.jpg","cast":["Caraly Sánchez","Scarlet Gruber","Carmen Ramos","Alisson Santiago","Giovanna Zacarías"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4TmFxjmCdnOAuRcyaqzHo7sJkG8.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4TmFxjmCdnOAuRcyaqzHo7sJkG8.jpg","air_date":"2023-01-25","episode_count":10,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Para Cada Ataque, Um Contra-Ataque","overview":"Apesar da ficha suja, Ángela consegue emprego rapidamente, e faz uma inimiga na mesma velocidade quando descobre que a lutadora Dulce assumiu seu lugar como mãe de Rocío.","air_date":"2023-01-25","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/Ah5MrdsgMYhCnU8ubNNAMa5jyLV.jpg","vote_average":0},"2":{"name":"Ringue Improvisado","overview":"Ángela decide começar o treinamento de luta livre. Depois que um passeio em família dá errado, Rocío vira piada na escola e culpa a mãe.","air_date":"2023-01-25","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/1Z01AD2ynEwS8AYsY1jtfJcaoBB.jpg","vote_average":0},"3":{"name":"Irmandade","overview":"A mãe de Ángela recebe uma má notícia. Betty ajuda Ángela e suas amigas a criar personagens de luta livre para o evento na escola de Rocío.","air_date":"2023-01-25","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/qkrcEHEtsKKnsGR6Vh2Thwue7JG.jpg","vote_average":0},"4":{"name":"Confie em Mim","overview":"O clima fica tenso quando Lucía decide ser advogada de Ángela. Rocío aprende uma dura lição sobre confiar nos outros, mas depois recebe uma boa notícia.","air_date":"2023-01-25","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/4oQF4MQNnw97eWos5syJWNFD6G3.jpg","vote_average":0},"5":{"name":"Absolvição","overview":"Ludark desafia Noiva Negra para uma luta, mas com a polícia em sua cola, Ángela acha melhor não chamar atenção. Só que as amigas dela discordam.","air_date":"2023-01-25","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/tTCBYuue6STyZYpM81SQWWyTViG.jpg","vote_average":0},"6":{"name":"O Benefício da Dúvida","overview":"Ángela suspeita que Lalo esteja ligado à sua prisão. Rocío arruma confusão na escola, mas é confortada por Dulce. Victoria tem um encontro.","air_date":"2023-01-25","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/4sWhvaOY6TxpwGoQ9mn9LC3e965.jpg","vote_average":0},"7":{"name":"Primeira e Última Vez","overview":"Rocío foge da casa de Lalo. O jeito impulsivo de Bety causa uma briga com Lucía. As amigas correm muito para chegar a uma luta em grupo.","air_date":"2023-01-25","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/bsX3h0EAjHX6Iu2kXcb4yL5nyFJ.jpg","vote_average":0},"8":{"name":"O Lado Sombrio","overview":"Mudar de ares fortalece Ángela no ringue, mas uma atitude arriscada nas ruas causa problemas para ela e a família.","air_date":"2023-01-25","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/1NQFtJvpgQwsvwRcBPJWg3gu9dl.jpg","vote_average":0},"9":{"name":"Golpe Inesperado","overview":"Ángela se une à polícia para criar uma armadilha. Uma revelação chocante faz Ángela se decepcionar com uma de suas melhores amigas.","air_date":"2023-01-25","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/3l29Sv6RJoRzASQ7TykfwpdseqV.jpg","vote_average":0},"10":{"name":"Dia dos Mortos","overview":"Desde ganhar o respeito de Rocío a uma chance de lutar na WWE, tudo está em jogo para Ángela. Mas para chegar lá, é preciso derrotar Docinho Caramelo.","air_date":"2023-01-25","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/zBbIjQxCuz53q0oS1OheEBMkl4w.jpg","vote_average":0}}}}},
